import React from 'react';

export default class HeaderMedium extends React.Component {
  render() {
    return (
      <>
        {this.props.displayName != null
          ? <h2 className='heading-medium + {}'>{this.props.displayName}</h2>
          : null}
      </>
    );
  }
}
